import * as C from './QuestionStyling';

export const Question = () => {
    const options = [
        "2", "8", "15", "undefined"
    ];
    return (
        <C.container>
            <C.question>
                <h1>What is the output of the following program?</h1>
            </C.question>
            <C.block>
                <p>
                    {"const add = (a,b) => {"}
                    {"return a + b;}"}
                </p>
                <p>
                    {"console.log(add(5,3));"}
                </p>
            </C.block>
            <C.optionsContainer>
                {options.map((option) => (
                    <C.option>
                        {option}
                    </C.option>
                ))}
            </C.optionsContainer>
        </C.container>
    );
}
